<!DOCTYPE html>
<meta charset="utf-8">
<style>

.links line {
  stroke: #000;
  stroke-opacity: 0.1;
}

.nodes circle {
  stroke: #fff;
  stroke-width: 1.5px;
}

text {
  font-family: sans-serif;
  font-size: 10px;
}

label {
  display: block;
}

button {
  display: block;
}

</style>
<label>Phx Link<input style="width:240px;" type="number" value="1" name="baselink"> </label>
<label>Phx Link Scale<input style="width:240px;" type="number" value="0.1" name="phxscale"> </label>
<label>Intercity Link<input style="width:240px;" type="number" value="1" name="interlink"> </label>
<label>Charge<input style="width:240px;" type="number" value="0" name="charge"> </label>
<label>Tor Position<input style="width:240px;" type="number" value="3" name="position"></label>
<label>Phx Position<input style="width:240px;" type="number" value="0" name="position_phx"></label>
<svg width="960" height="1200"></svg>

<script src="d3.v5.min.js"></script>
<script src="nudged.js"></script>
<script src="https://cdn.jsdelivr.net/npm/warpjs@1.0.8/dist/warp.js"></script>
<script>

var svg = d3.select("svg"),
    width = +svg.attr("width"),
    height = +svg.attr("height")/2;

var color = d3.scaleOrdinal(d3.schemeAccent);

base_link_strength = 1
intercity_link_strength = 1
location_strength = 3
phx_location_strength = 0
phx_scale = 0.1


var simulation = d3.forceSimulation()
    .force("link", d3.forceLink().id(function(d) { return d.group; })
      .distance(function(d) { return (1-d.type)*d.dist*(width+height)*phx_scale;})
      .strength(function(d) { return (base_link_strength*d.mobile + intercity_link_strength*d.type*d.sim);}))
    .force("charge", d3.forceManyBody()
      .strength(0))
    .force("xforce", d3.forceX().x(function (d) { return d.xo*width/4 + width/4;})
      .strength(function(d) { return phx_location_strength*d.mobile + location_strength*(1-d.mobile);}))
    .force("yforce", d3.forceY().y(function (d) { return (height-d.yo*height)/4+height/2;})
      .strength(function(d) { return phx_location_strength*d.mobile + location_strength*(1-d.mobile);}));

d3.json("city_export.json").then(function(graph) {
  phx_im = svg.append('svg:image')
    .attr("class","bkgrnd_im")
    .attr("id","phx_im")
    .attr('x', -2000)
    .attr('y', -2300)
    .attr('width', 4000)
    .attr('height', 4000)
    .attr('xlink:href', 'phx.svg')

  tor_im = svg.append('svg:image')
    .attr("class","bkgrnd_im")
    .attr("id","tor_im")
    .attr('x', -800)
    .attr('y', -1125)
    .attr('width', 3000)
    .attr('height', 3000)
    .attr('xlink:href', 'tor.svg')


  var link = svg.append("g")
      .attr("class", "links")
    .selectAll("line")
    .data(graph.links)
    .enter().append("line")

  node = svg.append("g")
      .attr("class", "nodes")
    .selectAll("g")
    .data(graph.nodes)
    .enter().append("g")
    
  var circles = node.append("circle")
      .attr("r", 5)
      .attr("fill", function(d) { return color(d.group); })
      .call(d3.drag()
          .on("start", dragstarted)
          .on("drag", dragged)
          .on("end", dragended));

  var lables = node.append("text")
      .text(function(d) {
        return d.name;
      })
      .attr('x', 6)
      .attr('y', 3);

  node.append("title")
      .text(function(d) { return d.name; });

  simulation
      .nodes(graph.nodes)
      .on("tick", ticked);

  simulation.force("link")
      .links(graph.links);

  function ticked() {
    display_transformation()
    link
        .attr("x1", function(d) { return d.source.x; })
        .attr("y1", function(d) { return d.source.y; })
        .attr("x2", function(d) { return d.target.x; })
        .attr("y2", function(d) { return d.target.y; })
        .style("stroke-width", 
          function(d) { 
            return Math.round(base_link_strength*d.mobile + intercity_link_strength*d.type*d.sim)+"px"; 
          });

    node
        .attr("transform", function(d) {
          return "translate(" + d.x + "," + d.y + ")";
        })
  }
});

function dragstarted(d) {
  if (!d3.event.active) simulation.alphaTarget(0.3).restart();
  d.fx = d.x;
  d.fy = d.y;
}

function dragged(d) {
  d.fx = d3.event.x;
  d.fy = d3.event.y;
}

function dragended(d) {
  if (!d3.event.active) simulation.alphaTarget(0);
  d.fx = null;
  d.fy = null;
}
d3.selectAll("input[type=number]")
    .on("input", inputted);

function inputted() {
  if (this.name=="baselink"){
    base_link_strength = +this.value
    simulation.force("link")
      .strength(function(d) { return base_link_strength*d.mobile + intercity_link_strength*d.type*d.sim;});
    simulation.alpha(0.1).restart();
  } else if (this.name=="interlink"){
    intercity_link_strength = +this.value
    simulation.force("link")
      .strength(function(d) { return base_link_strength*d.mobile + intercity_link_strength*d.type*d.sim;});
    simulation.alpha(0.1).restart();
  } else if (this.name=="phxscale"){
    phx_scale = +this.value
    simulation.force("link").distance(function(d) { return (1-d.type)*d.dist*(width+height)*phx_scale;});
    simulation.alpha(0.1).restart();
  } else if (this.name=="charge"){
    simulation.force("charge").strength(+this.value);
    simulation.alpha(0.1).restart();
  } else if (this.name=="position"){
    location_strength = +this.value
    simulation.force("xforce").strength(
      function(d) { return phx_location_strength*d.mobile + location_strength*(1-d.mobile);});
    simulation.force("yforce").strength(
      function(d) { return phx_location_strength*d.mobile + location_strength*(1-d.mobile);});
    simulation.alpha(0.1).restart();
  } else if (this.name=="position_phx"){
    phx_location_strength = +this.value
    simulation.force("xforce").strength(
      function(d) { return phx_location_strength*d.mobile + location_strength*(1-d.mobile);});
    simulation.force("yforce").strength(
      function(d) { return phx_location_strength*d.mobile + location_strength*(1-d.mobile);});
    simulation.alpha(0.1).restart();
  }
  
}

function display_transformation(){
  var domain = []
  var range = []
  d = node.data()
  for (i=0; i < d.length; i++){
    if (d[i]['mobile']==1) {
      domain.push([d[i]['xo']*width,height-d[i]['yo']*height])
      range.push([d[i]['x'],d[i]['y']])
    }
  }
  var trans = nudged.estimate('TSR', domain, range)
  
  phx_im.attr('transform', 'matrix('+Object.values(trans.getMatrix())+')')

  var domain = []
  var range = []
  d = node.data()
  for (i=0; i < d.length; i++){
    if (d[i]['mobile']==0) {
      domain.push([d[i]['xo']*width,height-d[i]['yo']*height])
      range.push([d[i]['x'],d[i]['y']])
    }
  }
  var trans = nudged.estimate('TSR', domain, range)
  tor_im.attr('transform', 'matrix('+Object.values(trans.getMatrix())+')')
}
